import React from "react";
import SearchBar from "./SearchBar/SearchBar";
import { Link } from "react-router-dom";

const Nav =({onSearch}) =>{
        return (
             <nav>
                  <div>
                 <button>
                    <Link to ="/About">About</Link>
                 </button>
                 <button>
                    <Link to ="/Home">Home</Link>
                 </button>
                 </div>
                 <SearchBar onSearch={onSearch}/> 
            </nav>
        )
}

export default Nav;
